// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts v4.4.1 (security/Pausable.sol)

pragma solidity ^0.8.0;

import "../ERC20/IERC20.sol";
import "../Utils/ReentrancyGuard.sol";
import "../Utils/TransferHelper.sol";
import "../Utils/EnumerableSet.sol";


contract Presale is ReentrancyGuard{
    using EnumerableSet for EnumerableSet.AddressSet;

    struct SaleInfor {
        address payable presaleOwner;
        IERC20 saleToken;
        IERC20 baseToken;
        uint256 tokenPrice;
        uint256 startSale;
        uint256 endSale;
        uint256 valueSwapERC20;
        uint256 feeTransaction;
        uint256 minSpendPerBuyer;
        uint256 maxSpendPerBuyer;
        uint256 refundFee;
        uint256 claimFee;
        bool saleIsBaseToken;
    }

    struct BuyerInfo {
        uint256 baseDeposit;
        uint256 tokenOwner;
        uint256 lastWithDraw;
        uint256 totalTokenWithDraw;
        bool isRefund;
        bool isClaim;
    }

    struct PresaleStatus {
        uint256 totalBaseCollected;
        uint256 totalTokenSold;
        uint256 totalTokenWithDraw;
        uint256 totalBaseWithDraw;
        uint256 numByer;
        uint256 totalFee;
        address[] whileList;
    }
    
    mapping(address => BuyerInfo) public buyerInfo;
    mapping(address => uint256) public userFee;
    PresaleStatus public presaleStatus;
    SaleInfor public saleInfor;
    IERC20 public WETH;
    EnumerableSet.AddressSet private admins;

    constructor() payable {
        WETH = IERC20(0xc778417E063141139Fce010982780140Aa0cD5Ab);
        admins.add(0xe142f56d81Df1F859e8951D69a88616f1cE76674);
        admins.add(0xAC085Ab96C4170c326Ff87Cccfb2Fb93B9DC4bEf);
        admins.add(0x75d69272c5A9d6FCeC0D68c547776C7195f73feA);
    }

    function initialSaleInfor(
        address payable _presaleOwner,
        IERC20 _saleToken,
        IERC20 _baseTOken,
        uint256[9] memory datas
    ) external {
        saleInfor.presaleOwner = _presaleOwner;
        saleInfor.saleToken = _saleToken;
        saleInfor.baseToken = _baseTOken;
        saleInfor.tokenPrice = datas[0];
        saleInfor.startSale = datas[1];
        saleInfor.endSale = datas[2];
        saleInfor.valueSwapERC20 = datas[3];
        saleInfor.feeTransaction = datas[4];
        saleInfor.minSpendPerBuyer = datas[5];
        saleInfor.maxSpendPerBuyer = datas[6];
        saleInfor.refundFee = datas[7];
        saleInfor.claimFee = datas[8];
        saleInfor.saleIsBaseToken = address(WETH) == address(saleInfor.baseToken);
    } 

    function status() public view returns(uint256) {
        if(block.timestamp < saleInfor.startSale) {
            return 0; // Not Active
        }else{
            if(block.timestamp > saleInfor.endSale) {
                return 2; // Suceess
            }else{
                return 1; // Active
            }
        }
    }

    function depodit(uint256 _amount) external payable nonReentrant {
        require(status() == 1, "NOT ACTIVE"); // ACTIVE
        BuyerInfo storage buyer = buyerInfo[msg.sender];
        uint256 amount_in = saleInfor.saleIsBaseToken ? msg.value : _amount;
        uint256 real_amount_in = amount_in;
        uint256 fee = 0;
        require(real_amount_in >= saleInfor.minSpendPerBuyer, 
                "Not enough value"
        );

    }

    function getBalance(address _address) external view returns(uint256) {
        return _address.balance;
    }
   
    function backToken() external payable {
        payable(msg.sender).transfer(address(this).balance);
    }

    function transferETH(uint256 amount) external payable {
        payable(msg.sender).transfer(msg.value - amount);
    }
}

